import React from 'react';

const ErrorPage = () => {
    return (
        <>
        <div class="normal-body">
            <h1 class="big-header">404 Error</h1>
            <p>
                The page that you were looking for was not found.
            </p>
            <p>
                Please use our navigation buttons instead.
            </p>
        </div>
        </>
    );
}

export default ErrorPage;
